import './Projects.css';

const Projects = () => {

    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        SlidesToScroll: 1,
        autoplay: true,
        autoplayspeed: 3000,
    };

    const projects = [
        {
            title: 'Project 1',
            description: 'description',
            link: 'link',
        },
        {
            title: 'Project 2',
            description: 'description',
            link: 'link',
        },
        {
            title: 'Project 3',
            description: 'description',
            link: 'link',
        },
    ];

    return (
    <section className="projects">
        <div className="carousel">
            <h2>Projects</h2>
            <div className="project-card">
                <h3>project 1</h3>
                <p>description</p>
            </div>
            <div className="project-card">
                <h3>project 2</h3>
                <p>description</p>
            </div>
            <div className="project-card">
                <h3>project 3</h3>
                <p>description</p>
            </div>
        </div>
    </section>
    );
};
export default Projects;
